1) Заполняется необходимое количество данных листов по каждому транспортному средству. По коду строки 010 в последующих листах проставляется прочерк;
2) Заполняется индивидуальным предпринимателем, который планирует осуществлять на основе патента один из следующих видов предпринимательской деятельности:
- оказания автотранспортных услуг по перевозке грузов автомобильным транспортом (подпункт 10 пункта 2 статьи 346.43 НК РФ),
- оказания автотранспортных услуг по перевозке пассажиров автомобильным транспортом (подпункт 11 пункта 2 статьи 346.43 НК РФ),
- оказания услуг по перевозке пассажиров водным транспортом (подпункт 32 пункта 2 статьи 346.43 НК РФ),
- оказания услуг по перевозке грузов водным транспортом (подпункт 33 пункта 2 статьи 346.43 НК РФ);
3) Указывается один из следующих кодов транспортных средств:
01 - автомобильный транспорт по перевозке грузов;
02 - автомобильный транспорт по перевозке пассажиров;
03 - водный транспорт по перевозке пассажиров;
04 - водный транспорт по перевозке грузов.
4) По наземным транспортным средствам указывается идентификационный номер – VIN.
По водным транспортным средствам указывается идентификационный номер судна ИМО;
5) Указывается из документа о государственной регистрации транспортного средства;
6) По водным транспортным средствам указывается регистрационный номер судна.

1) Заполняется необходимое количество данных листов по обособленному объекту.
2) Заполняется только индивидуальным предпринимателем, который планирует осуществлять на основе патента один из следующих видов предпринимательской
деятельности:
- сдача в аренду (наем) жилых и нежилых помещений, дач, земельных участков, принадлежащих индивидуальному предпринимателю на праве собственности
(подпункт 19 пункта 2 статьи 346.43 НК РФ);
- розничная торговля через объекты стационарной торговой сети с площадью торгового зала не более 50 квадратных метров по объекту организации
торговли (подпункт 45 пункта 2 статьи 346.43 НК РФ);
- розничная торговля через объекты стационарной торговой сети, не имеющие торговых залов, а также через объекты нестационарной торговой сети
(подпункт 46 пункта 2 статьи 346.43 НК РФ);
- услуги общественного питания, оказываемые через объекты организации общественного питания с площадью зала обслуживания посетителей не более
50 квадратных метров по объекту организации общественного питания (подпункт 47 пункта 2 статьи 346.43 НК РФ).
3) Указываются соответствующие коды обособленного объекта:
05 – жилое помещение;
06 – нежилое помещение;
07 - дача;
08 - земельный участок;
09 - магазин;
10 – павильон;
11 - розничный рынок;
12 - ярмарка;
13 – киоск;
14 - палатка;
15 – торговый автомат;
16 - автолавка;
17 - автомагазин;
18 - тонар;
19 - автоприцеп;
20 - передвижной торговый автомат;
21 - ресторан;
22 - бар;
23 - кафе;
24 - столовая;
25 - закусочная;
26 - услуги питания предприятий других типов.
4) Указывается признак объекта:
1 - площадь сдаваемого в аренду объекта;
2 - площадь объекта стационарной торговой сети, имеющего торговый зал (магазина, павильона);
3 - площадь торгового зала по объекту организации торговли;
4 – площадь торгового места в объекте стационарной торговой сети, не имеющем торгового зала (в розничном рынке, ярмарке, киоске);
5) - площадь объекта организации общественного питания (ресторана, бара, кафе, столовой, закусочной), имеющего зал обслуживания посетителей;
6) - площадь зала обслуживания посетителей по объекту организации общественного питания.
